import React from 'react';
import { Grid, Table, TableBody, TableCell, TableHead, TableRow, Typography, Paper } from '@mui/material';
import { styled } from '@mui/system';


// Exemple de données des joueurs sanctionnés
const sanctionsData = [
    {
        id: 1,
        name: "Joueur 1",
        flag: "/images/profiles/joueur1.png",
        warnings: 2,
        reason: "Comportement antisportif",
        date: "2024-10-15",
        status: "Active"
    },
    {
        id: 2,
        name: "Joueur 2",
        flag: "/images/profiles/joueur2.png",
        warnings: 1,
        reason: "Retard",
        date: "2024-10-12",
        status: "Active"
    },
    {
        id: 3,
        name: "Joueur 3",
        flag: "/images/profiles/joueur3.png",
        warnings: 3,
        reason: "Abandon de match",
        date: "2024-10-10",
        status: "Sanctionné"
    },
];

// Style personnalisé pour les images des joueurs
const Flag = styled('img')({
    width: '80px',
    height: '60px',
    marginRight: '10px',
    borderRadius: '4px',
});

// Style conditionnel pour la colonne "Statut"
const getStatusStyle = (status) => {
    switch (status) {
        case "Active":
            return { color: 'green', fontWeight: 'bold' }; // Texte vert et en gras
        case "Sanctionné":
            return { color: 'red', fontWeight: 'bold' }; // Texte rouge et en gras
        default:
            return { color: 'black', fontWeight: 'bold' }; // Par défaut en noir et en gras
    }
};
const Sanctions = () => {
    return (
        <div className="sanctions-container">
            <Typography variant="h4" className="category-title" style={{ textAlign: 'center', marginBottom: '20px' }}>
                Liste des Sanctions
            </Typography>
            <Grid container spacing={4} justifyContent="center">
                <Grid item xs={12} md={10}>
                    <Paper elevation={3} style={{ padding: '20px', backgroundColor: '#1C1C1C', color: 'white' }}>
                        <Table>
                            <TableHead>
                                <TableRow>
                                    <TableCell align="center" style={{ color: 'white', fontWeight: 'bold' }}>#</TableCell>
                                    <TableCell align="center" style={{ color: 'white', fontWeight: 'bold' }}>Photo</TableCell>
                                    <TableCell align="center" style={{ color: 'white', fontWeight: 'bold' }}>Nom du joueur</TableCell>
                                    <TableCell align="center" style={{ color: 'white', fontWeight: 'bold' }}>Nombre d'avertissements</TableCell>
                                    <TableCell align="center" style={{ color: 'white', fontWeight: 'bold' }}>Raison</TableCell>
                                    <TableCell align="center" style={{ color: 'white', fontWeight: 'bold' }}>Date</TableCell>
                                    <TableCell align="center" style={{ color: 'white', fontWeight: 'bold' }}>Statut</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                {sanctionsData.map((joueur) => (
                                    <TableRow key={joueur.id}>
                                        <TableCell align="center">{joueur.id}</TableCell> {/* Numéro du joueur */}
                                        <TableCell align="center">
                                            <Flag src={joueur.flag} alt={joueur.name} /> {/* Photo du joueur */}
                                        </TableCell>
                                        <TableCell align="center">{joueur.name}</TableCell> {/* Nom du joueur */}
                                        <TableCell align="center">{joueur.warnings}</TableCell> {/* Nombre d'avertissements */}
                                        <TableCell align="center">{joueur.reason}</TableCell> {/* Raison de la sanction */}
                                        <TableCell align="center">{joueur.date}</TableCell> {/* Date de la sanction */}
                                        <TableCell align="center">{joueur.status}</TableCell> {/* Statut de la sanction */}
                                    </TableRow>
                                ))}
                            </TableBody>
                        </Table>
                    </Paper>
                </Grid>
            </Grid>
        </div>
    );
};

export default Sanctions;
